import React from "react";
import {Card, Button} from "@shopify/polaris";


export default class Index extends React.Component {
  render() {
    return (
      <header sectioned title="Dashboard" actions={[{content: 'Add variant'}]}>
  <p>
    Home
  </p>
  
</header>

    );  
  }
}
